Having to write out the paths to call functions can feel inconvenient and repetitive. In Listing 7-7, whether we chose the absolute or relative path to the add_to_waitlist function, every time we wanted to call add_to_waitlist we had to specify front_of_house and hosting too. Fortunately, there's a way to simplify this process: we can create a shortcut to a path with the use keyword once, and then use the shorter name everywhere else in the scope. In Listing 7-11, we bring the crate::front_of_house::hosting module into the scope of the eat_at_restaurant function so we only have to specify hosting::add_to_waitlist to call the add_to_waitlist function in eat_at_restaurant. mod front_of_house { pub mod hosting { pub fn add_to_waitlist() {} }
} use crate::front_of_house::hosting; pub fn eat_at_restaurant() { hosting::add_to_waitlist();
} Listing 7-11: Bringing a module into scope with use Adding use and a path in a scope is similar to creating a symbolic link in the filesystem. By adding use crate::front_of_house::hosting in the crate root, hosting is now a valid name in that scope, just as though the hosting module had been defined in the crate root. Paths brought into scope with use also check privacy, like any other paths. Note that use only creates the shortcut for the particular scope in which the use occurs. Listing 7-12 moves the eat_at_restaurant function into a new child module named customer, which is then a different scope that the use statement, so the function body won't compile. mod front_of_house { pub mod hosting { pub fn add_to_waitlist() {} }
} use crate::front_of_house::hosting; mod customer { pub fn eat_at_restaurant() { hosting::add_to_waitlist(); }
} Listing 7-12: A use statement only applies in the scope it's in. The compiler error shows that the shortcut no longer applies within the custoner module: $ cargo build Compiling restaurant v0.1.0 (C:\Users\jerok\projects\study_blog\rust_lang_book\code\ch07\restaurant)
error[E0433]: failed to resolve: use of undeclared crate or module `hosting` --> src\lib.rs:11:9 |
11 | hosting::add_to_waitlist(); | ^^^^^^^ use of undeclared crate or module `hosting` warning: unused import: `crate::front_of_house::hosting` --> src\lib.rs:7:5 |
7 | use crate::front_of_house::hosting; | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ | = note: `#[warn(unused_imports)]` on by default Notice there's also a warning that the use is no longer used in its scope! To fix this problem, move the use within the customer module too, or reference the shortcut in the parent module with super::hosting within the child customer module.

103.body:
In Listing 7-11, you might have wondered why we specified use crate::front_of_house::hosting and then called hosting::add_to_waitlist in eat_at_restaurant, rather than specifying the use path all the way out to the add_to_waitlist function to achieve the same result, as in Listing 7-13. mod front_of_house { pub mod hosting { pub fn add_to_waitlist() {} }
} use crate::front_of_house::hosting::add_to_waitlist; pub fn eat_at_restaurant() { add_to_waitlist();
} Listing 7-13: Bringing the add_to_waitlist function into scope with use, which is unidiomatic Although both Listing 7-11 and Listing 7-13 accomplish the same task, Listing 7-11 is the idiomatic way to bring a function into scope with use. Bringing the function's parent module into scope with use means we have to specify the parent module when calling the function. Specifying the parent module when calling the function. Specifying the parent module when calling the function makes it clear that the function isn't locally defined while still minimizing repetition of the full path. The code in Listing 7-13 is unclear as to where add_to_waitlist is defined. On the other hand, when bringing in structs, enums, and other items with use, it's idiomatic to specify the full path. Listing 7-13 shows the idiomatic way to bring the standard library's HashMap struct into the scope of binary crate. use std::collections::HashMap; fn main() { let mut map = HashMap::new(); map.insert(1, 2);
} Listing 7-14: Bringing HashMap into scope in an idiomatic way There's no strong reason behind this idiom: it's just the convention that has emerged, and folks have gotten used to reading and writing Rust code this way. The exception to this idiom is if we're bringing two items with the same name into scope with use statements, because Rust doesn't allow that. Listing 7-15 shows how to bring two Result types into scope that have the same name but different parent modules, and how to refer to them. use std::fmt;
use std::io; fn function1() -> fmt::Result { // snip
} fn function2() -> io::Result<()> { // snip
} Listing 7-15: Bringing two types with the same name into the same scope requires using their parent modules. As you can see, using the parent modules distinguishes the two Result types. If instead we specified use std::fmt::Result and use std::io::Result, we'd have two Result types in the same scope, and Rust wouldn't know which one we meant when we used Result.

104.body:
There's another solution to the problem of bringing two types of the same name into the same scope with use: after the path, we can specify as and a new local name, or alias, for the type. Listing 7-16 shows another way to write the code in Listing 7-15 by renaming one of the two Result types using as. use std::fmt::Result;
use std::io::Result as IoResult; fn function1() -> Result { // snip
} fn function2() -> IoResult<()> { // snip
} Listing 7-16: Renaming a type when it's brought into scope with the as keyword In the second use statement, we chose the new name IoResult for the std::io:Result type, which won't conflict with the Result from std::fmt that we've also brought into scope. Listing 7-15 and Listing 7-16 are considered idiomatic, so the choice is up to you!

105.body:
When we bring a name into scope with the use keyword, the name available in the new scope is private. To enable the code that calls our code to refer to that name as if it had been defined in that code's scope, we can combine pub and use. This technique is called re-exporting because we're bringing an item into scope but also making that item available for others to bring into their scope. Listing 7-17 shows the code in Listing 7-11 with use in the root module changed to pub use. mod front_of_house { pub mod hosting { pub fn add_to_waitlist() {} }
} pub use crate::front_of_house::hosting; pub fn eat_at_restaurant() { hosting::add_to_waitlist();
} Listing 7-17: Making a name available for any code to use from a new scope with pub use Before this change, external code would have to call the add_to_waitlist function by using the path restaurant::front_of_house::hosting::add_to_waitlist(). Now that this pub use has re-exported the hosting module from the root module, external code can use the path restaurant::hosting::add_to_waitlist() instead. Re-exporting is useful when the internal structure of your code is different from how programmers calling your code would think about the domain. For example, in this restaurant metaphor, the people running the restaurant think about " front of house" and "back of house". But customers visiting a restaurant probably won't think about the parts of the restaurant in those terms. With pub use, we can write our code with one structure but expose a different structure. Doing so makes our library well organized for programmers working on the library and programmers calling the library. We'll look at another example of pub use and how it affects your crate's documentation in "Exporting a Convenient Public API with pub use".

