Next, make a new source file and call it main.rs. Rust files always end with the .rs extension. If you're using more than one word in your filename, the convention is to use an underscore to separate them. For example, use hello_world.rs rather than helloworld.rs. fn main() { println!("Hello, world!");
} $ rustc main.rs
$ ./main
Hello, world! If Hello, world! did print, congratulations! You've officially written a Rust program. That makes you a Rust programmer - welcome!

