We'll create a variable to store the user input, like this: # use std::io;
# # fn main() {
# println!("Guess the number!");
# println!("Please input your guess.");
# let mut guess = String::new();
# # io::stdin()
# .read_line(&mut guess)
# .expect("Failed to read line");
# # println!("You guessed: {guess}");
# } We use the let statement to create the variable. Here's another example: let apples = 5; This line creates a new variable named apples and binds it to the value 5. In Rust, variables are immutable by default, meaning once we give the variable a value, the value won't change. We'll be discussing this concept in detail in "Variables and Mutability". To make a variable mutable, we add mut before the variable name: let apples = 5; // immutable
let mut bananas = 5; // mutable let mut guess will introduce a mutable variable named guess. The equal sign (=) tells Rust we want to bind something to the variable now. On the right of the equal sign is the value that guess is bound to, which is the result of calling String::new, a function that returns a new instance of a String. String is a string type provided by the standard library that is a growable, UTF-8 encoded bit of text. The :: syntax in the ::new line indicates that new is an associated function of the String type. An associated function is a function that's implemented on a type, in this case String. This new function creates a new, empty string. You'll find a new function on many types because it's a common name for a function that makes a new value of some kind. In full, the let mut guess = String::new(); line has created a mutable variable that is currently bound to a new, empty instance of a String.

