# use std::io;
# # fn main() {
# println!("Guess the number!");
# println!("Please input your guess.");
# # let mut guess = String::new();
# # io::stdin()
# .read_line(&mut guess) .expect("Failed to read line");
# # println!("You guessed: {guess}");
# } read_line puts whatever the user enters into the string we pass to it, but it also returns a Result value. Result is an enumeration, often called an enum, which is a type that can be in one of multiple possible states. We call each possible state a variant. The purpose of these Result type is to encode error-handling information. Result's variants are Ok and Err. The Ok variant indicates the operation was successful, and inside Ok is the successfully generated value. The Err variant means the operation failed, and Err contains information about how or why the operation failed. Values of the Result type, like values of any type, have methods defined on them. An instance of Result has an expect method that you can call. If this instance of Result is an Err value, expect will cause the program to crash and display the message that you passed as an argument to expect. If the read_line method returns an Err, it would likely be the result of an error coming from the underlying operating system. If this instance of Result is an Ok value, expect will take the return value that Ok is holding and return just that value to you so you can use it. In this case, that value is the number of bytes in the user's input. If you don't call expect, the program will compile, but you'll get a warning: $ cargo build
warning: unused `Result` that must be used --> src\main.rs:9:5 |
9 | / io::stdin()
10 | | .read_line(&mut guess); | |_______________________________^ | = note: `#[warn(unused_must_use)]` on by default = note: this `Result` may be an `Err` variant, which should be handled warning: `guessing_game` (bin "guessing_game") generated 1 warning Finished dev [unoptimized + debuginfo] target(s) in 0.02s Rust warns that you haven't used the Result value returned from read_line, indicating that the program hasn't handled a possible error. The right way to suppress the warning is to actually write error-handling code, but in our case we just want to crash this program when a problem occurs, so we can use expect.

