Let's start using rand to generate a number to guess. The next step is to update src/main.rs # use std::io;
use rand::Rng; // 1
# # fn main() {
# println!("Guess the number!");
# let secret_number = rand::thread_rng().gen_range(1..=100); // 2 println!("The secret number is: {secret_number}"); // 3
# # println!("Please input your guess.");
# # let mut guess = String::new();
# # io::stdin()
# .read_line(&mut guess)
# .expect("Failed to read line");
# # println!("You guessed: {guess}");
# } First we add the line use rand::Rng;(1). The Rng trait defines methods that random number generators implement, and this trait must be in scope for ust to use those methods. Chapter 10 will cover traits in detail. Next, we're adding two lines in the middle. In the first line (2), we call the rand::thread_rng function that gives us the particular random number generator we're going to use: one that is local to the current thread of execution and is seeded by the operating system. Then we call the gen_range method on the random number generator. This method is defined by the Rng trait that we brought into scope with the use rand::Rng; statement. The gen_range method takes a range expression as an argument and generates a random number in the rage. The kind of range expression we're using here takes the from start..=end and is inclusive on the lower and upper bounds, so we need to specify 1..=100 to request a number between 1 and 100. You won't just know which traits to use and which methods and functions to call from a crate, so each crate has documentation with instructions for using it. Another neat feature of Cargo is that running the cargo doc --open command will build documentation provided by all your dependencies locally and open it in your browser. If you're interested in other functionality in the rand crate, for example, run cargo doc --open and click rand in the sidebar on the left. The second new line (3) prints the secret number. This is useful while we're developing the program to be able to test it, but we'll delete it from the final version. It's not much of a game if the program prints the answer as soon as it starts!

