Let's return to the error in Listing 7-4 that told us the hosting module is private. We want the eat_at_restaurant function in the parent module to have access to the add_to_waitlist function in the child module, so we mark the hosting module with the pub keyword, as shown in Listing 7-5. mod front_of_house { pub mod hosting { fn add_to_waitlist() {} }
} pub fn eat_at_restaurant() { // Absolute path crate::front_of_house::hosting::add_to_waitlist(); // Relative path front_of_house::hosting::add_to_waitlist();
} Listing 7-5: Declaring the hosting module as pub to use it from eat_at_restaurant Unfortunately, the code in Listing 7-5 still results in compiler errors, as shown in Listing 7-6. $ cargo build Compiling restaurant v0.1.0 (C:\Users\jerok\projects\study_blog\rust_lang_book\code\ch07\restaurant)
error[E0603]: function `add_to_waitlist` is private --> src\lib.rs:9:37 |
9 | crate::front_of_house::hosting::add_to_waitlist(); | ^^^^^^^^^^^^^^^ private function |
note: the function `add_to_waitlist` is defined here --> src\lib.rs:3:9 |
3 | fn add_to_waitlist() {} | ^^^^^^^^^^^^^^^^^^^^ error[E0603]: function `add_to_waitlist` is private --> src\lib.rs:12:30 |
12 | front_of_house::hosting::add_to_waitlist(); | ^^^^^^^^^^^^^^^ private function |
note: the function `add_to_waitlist` is defined here --> src\lib.rs:3:9 |
3 | fn add_to_waitlist() {} | ^^^^^^^^^^^^^^^^^^^^ Listing 7-6: Compiler errors from building the code in Listing 7-5 What happened? Adding the pub keyword in front of mod hosting make the module public. With this change, if we can access front_of_house, we can access hosting. But the contents of hosting are still private; making the module public doesn't make its contents public. The pub keyword on a module only lets code in its ancestor modules refer to it, not access its inner code. Because modules are containers, there's not much we can do by only making the module public; we need to go further and choose to make one or more of the items within the module public as well. The errors in Listing 7-6 says that the add_to_waitlist function is private. The privacy rules apply to structs, enums, functions, and methods as well as modules. Let's also make the add_to_waitlist function public by adding the pub keyword before its definition, as in Listing 7-7. mod front_of_house { pub mod hosting { pub fn add_to_waitlist() {} }
} pub fn eat_at_restaurant() { // Absolute path crate::front_of_house::hosting::add_to_waitlist(); // Relative path front_of_house::hosting::add_to_waitlist();
} Listing 7-7: Adding the pub keyword to mod hosting and fn add_to_waitlitst lets us call the function from eat_at_restaurant. Now the code will compile! To see why adding the pub keyword lets us use these paths in add_to_waitlist with respect to the privacy rules, let's look at the absolute and the relative paths. In the absolute path, we start with crate, the root of our crate's module tree. The front_of_house module is defined in the crate root. While front_of_house isn't public, because the eat_at_restaurant function is defined in the same module as front_of_house (that is, eat_at_restaurant and front_of_house are siblings), we can refer to front_of_house from eat_at_restaurant. Next is the hosting module marked with pub. We can access the parent module of hosting, so we can access hosting. Finally, the add_to_waitlist function is marked with pub and we can access its parent module, so this function call works! In the relative path, the logic is the same as the absolute path except for the first step: rather than starting from the crate root, the path starts from front_of_house. The front_of_house module is defined within the same module as eat_at_restaurant, so the relative path starting from the module in which eat_at_restaurant is defined works. Then, because hosting and add_to_waitlist are marked with pub, the rest of the path works, and this function call is valid! If you plan on sharing your library crate so other projects can use your code, your public API is your contract with users of your crate that determines how they can interact with your code. There are many considerations around managing changes to your public API to make it easier for people to depend on your crate. These considerations are beyond the scope of this book; if you're interested in this topic, see the Rust API Guidelines at https://rust-lang.github.io/api-guidelines. Best Practices for Packages with a Binary and a Library We mentioned that a package can contain both a src/main.rs binary crate root as well as a src/lib.rs` library crate root, and both crates will have the package name by default. Typically, packages with this pattern of containing both a library and a binary crate will have just enough code in the binary crate to start an executable that calls code with the library crate. This lets other projects benefit from the most functionality that the package provides because the library crate's code can be shared. The module tree should be defined in src/lib.rs. Then any public items can be used in the binary crate by starting paths with the name of the package. The binary crate becomes a user of the library crate just like a completely external crate would use the library crate: it can only use the public API. This helps you design a good API; not only are you the author, you're also a client! In Chapter 12, we'll demonstrate this organizational practice with a command line program that will contain both a binary crate and a library crate.
